import React from "react";
import styled from "styled-components";

const StyledLocal = styled.div`
  border: 1px solid black;
  border-radius: 6px;
  width: 30%;
  margin: 0 1% 2%;
  height: 300px;
`;

export default function Local({ props }) {
  return (
    <StyledLocal>
      <img src={props.img} alt="Local" />
      <h3>{props.name}</h3>
    </StyledLocal>
  );
}
